class StringCount extends RecursiveTask<Integer>{
	private int start;
	private int end;
	private static String currentString;
	private static String[] stringArray;
	
	public StringCount(int start, int end) {
		super();
		this.start = start;
		this.end = end;
	}

	public static void setCurrentString(String currentString) {
		StringCount.currentString = currentString;
	}
	
	public static void setStringArray(String[] stringArray) {
		StringCount.stringArray = stringArray;
	}

	@Override
	protected Integer compute() {
		if((end-start)>0) {
			StringCount stringCount1 = new StringCount(start, (start+(int)Math.floor((end-start)/2)));
			StringCount stringCount2 = new StringCount((start+(int)Math.floor((end-start)/2))+1,end);
			stringCount1.fork();
			stringCount2.fork();
			
			return Integer.valueOf(stringCount1.join()+stringCount2.join());
		}
		else if((end-start)==0) {
			if(stringArray[start].equalsIgnoreCase(currentString)) {
				return Integer.valueOf(1);
			}
		}
		
		return Integer.valueOf(0);
		
	}
}
